DESCRIPTION
The darkest hour is just before dawn.Lance can`t make it till morning without night terrors. He`s a man with emotional baggage, and his thoughts turn against him from dusk till dawn. Vera`s a hooker, and she`s fed up with Johns, lonely hotel rooms and, well, life in general. Until she gets a call from Lance. He needs someone to sleep next to him and protect him from the night terrors. No sex, just company... at least for now. By the end of the week they`re in love. But Vera can`t shake the feeling of being used, and Lance can`t shake the feeling of Vera. Can two damaged souls find love and repair and a happily ever after? The secrets of the night, revealed, in this important new feature from Vivid and B. Skow.
